import React from "react";
import "./App.css";

function indexContents() {
    return (
        <div id="index-contents">
            <h1>I am your index page!!!</h1>
            <FartThePotato potatoType="Japanese Sweet Potato" />
            <FartThePotato potatoType="Garnet" />
            <FartThePotato potatoType="Ruby" />
            <ClickyBtn />
            <Clock />
        </div>
    );
}

function FartThePotato(pname) {
    return <h3>{pname.potatoType} has been farted</h3>;
}

function ClickyBtn() {
    function iwasclicked(e) {
        e.preventDefault();
        console.log("You clicked MEEE");
    }

    return <button onClick={iwasclicked}>Click me</button>;
}

// react JS website  example https://reactjs.org/docs/state-and-lifecycle.html
class Clock extends React.Component {
    constructor(props) {
        super(props);
        this.state = { date: new Date() };
    }

    componentDidMount() {
        this.timerID = setInterval(() => this.tick(), 1000);
    }

    componentWillUnmount() {
        clearInterval(this.timerID);
    }

    tick() {
        this.setState({
            date: new Date()
        });
    }

    render() {
        return (
            <div>
                <h1>Hello, world!</h1>
                <h2>It is {this.state.date.toLocaleTimeString()}.</h2>
            </div>
        );
    }
}

// my code again

const mainWebsiteFormat = <div id="page-body">{indexContents()}</div>;

function App() {
    return mainWebsiteFormat;
}

export default App;
